import React, {Component} from 'react';
import {Link} from "react-router-dom";

import '../css/pages/details.css';

class DetailsComponent extends Component{
    render() {
        return(
            <div className="details-container">
                <div className="w3-row">
                    <div className="w3-col s12 m6 l6 ">
                        <div className='details-img-container'>
                            {/*{stuff}*/}
                            <img className='details-img' src={require('../assets/images/meat.png')} alt=""/>
                        </div>
                    </div>
                    <div className="w3-col s12 m6 l6 ">
                        <div className='product-details'>
                            <div className='details-first-div'>
                                <h1>Vegetables</h1>
                                <h5 className='details-price'>$56.40 <span className='line-through'>$80.50</span>
                                </h5>
                            </div>
                            <div className='details-quantity'>
                                <h4>Quantity</h4>
                                <input className='input-quantity' type="number" placeholder='1'/>
                                <Link to={''} className="add-cart">ADD TO CART</Link>
                            </div>
                            <h4>DESCRIPTION</h4>
                            <hr/>
                            <p>This is the best veges in the country</p>
                            <hr/>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default DetailsComponent;
